import React, { useState } from 'react';
import { TextField, Button, Table, TableHead, TableBody, TableCell, TableRow } from '@mui/material';

function App() {
  const [value, setValue] = useState('');
  const [notes, setNotes] = useState([]);

  const handleClick = () => {
    setNotes([...notes, value]);
    setValue('');
  };

  const handleChange = (e) => {
    setValue(e.target.value);
  };

  return (
    <>
      <TextField
        label="Note"
        variant="outlined"
        value={value}
        onChange={handleChange}
        fullWidth
        margin="normal"
      />
      <Button variant="contained" color="primary" onClick={handleClick}>
        Add Note
      </Button>

      <Table>
        <TableHead>
          <TableRow>
            <TableCell>ID</TableCell>
            <TableCell>Value</TableCell>
          </TableRow>
        </TableHead>

        <TableBody>
          {notes.map((row, index) => (
            <React.Fragment key={index}>
              <TableRow>
                <TableCell>{index}</TableCell>
                <TableCell>{row}</TableCell>
              </TableRow>
              {index < notes.length - 1 && ( // Add border only if it's not the last row
                <TableRow>
                  <TableCell style={{ borderTop: '1px solid #e0e0e0' }} colSpan={2}></TableCell>
                </TableRow>
              )}
            </React.Fragment>
          ))}
        </TableBody>
      </Table>
    </>
  );
}

export default App;
